</body>
<SCRIPT>
var time = document.getElementsByClassName('time')[0];
var pic = document.getElementsByTagName('img')[0];
var img = document.getElementsByClassName('pic')[0];
var menu = document.getElementsByClassName('menu')[0];
var menu_div = document.getElementsByClassName('menu_div')[0];
var _name = document.getElementsByClassName('name')[0];
var no = document.getElementsByClassName('no')[0];
var now_mode = 0;
var timeb = '';
var times = 22;
var names = 21;
var nos = 21;
var pics = 190;
var pict = 220;
if(localStorage._name){_name.innerText = localStorage._name}
if(localStorage.no){no.innerText = localStorage.no}
if(localStorage.timeb){timeb = localStorage.timeb}
if(localStorage.times){times = localStorage.times}
if(localStorage.names){names = localStorage.names}
if(localStorage.nos){nos = localStorage.nos}
if(localStorage.pics){pics = localStorage.pics}
if(localStorage.pict){pict = localStorage.pict}
setInterval(()=>{localStorage._name = _name.innerText;localStorage.no = no.innerText;localStorage.pics = pics.toString();localStorage.nos = nos.toString();localStorage.names = names.toString();localStorage.times = times.toString();localStorage.timeb = timeb;localStorage.pict = pict;}, 500);
_name.style.fontSize = names + "px";
no.style.fontSize = nos + "px";
time.style.fontSize = times + "px";
time.style.fontWeight = timeb;
img.style.marginTop = pict + "px";
time.onclick = (e)=>{
	if(!now_mode){return}
	if(timeb==''){timeb='bold'}
	else{times++;timeb=''}
	if(times > 40){times = 18}
	time.style.fontWeight = timeb;
	time.style.fontSize = times + "px";
};
_name.onclick = (e)=>{
	if(!now_mode){return}
	if(++names > 40){names = 18}
	_name.style.fontSize = names + "px";
};
no.onclick = (e)=>{
	if(!now_mode){return}
	if(++nos > 40){nos = 18}
	no.style.fontSize = nos + "px";
};
pic.onclick = (e)=>{
	if(!now_mode){
		pict = Number(pict) + 10;
		if(pict > 320){pict = 190}
		img.style.marginTop = pict + "px";
	return}
	pics = Number(pics) + 10;
	if(pics > 280){pics = 160}
};
menu.onclick = (e)=>{
	now_mode = 1;
	menu_div.style.display = 'block';
	menu_div.innerText = '点击图片文字可编辑大小（点击退出）';
	_name.contentEditable = false;
	no.contentEditable = false;
};
menu_div.onclick = (e)=>{
	now_mode = 0;
	menu_div.style.display = '';
	menu_div.innerText = '';
	_name.contentEditable = true;
	no.contentEditable = true;
};
//menu.click();
function re(){let t=new Date();t=t.getFullYear()+"-"+(t.getMonth()+1>9?"":"0")+(t.getMonth()+1)+"-"+(t.getDate()>9?"":"0")+(t.getDate())+" "+(t.getHours()>9?"":"0")+(t.getHours())+":"+(t.getMinutes()>9?"":"0")+(t.getMinutes())+":"+(t.getSeconds()>9?"":"0")+(t.getSeconds());time.innerText=t;}
setInterval(re, 1000);re();
setInterval(()=>{time.style.transition="0s";time.style.borderColor="#03A7EF";setTimeout(()=>{time.style.transition="1s";time.style.borderColor="#fff";}, 10)}, 1000);
setInterval(()=>{pic.style.width=pic.style.width==pics+'px'?(pics-20)+'px':pics+'px'}, 500);
</SCRIPT>
